import React, {useState} from 'react';
import './Header.scss';

const Header = () => {
    const [open, setOpen] = useState(false);
    const navMenu = "nav-menu";
    const navMenuOpen= "nav-menuOpen";
    return (
        <div className="header">
            <div className={open ? navMenuOpen : navMenu}
            >   
                <br />
                <br />
                <div ><span className="ham"
                onClick={()=> setOpen(!open)}
                >Boton</span></div>
                <br />
                <br />
                <br />
                <div>
                    Lista de Usuarios
                </div>
                <br />
                <br />
                <br />
                <div>
                    Albumes
                </div>
            </div>
            <div className="logo">
                User Profile
            </div>
            <div className="">
                <span>&nbsp;/////////imagen</span>
            </div>
        </div>
    );
};

export default Header;
